import React, { Component } from 'react';

class List extends Component {    
  render() {
    return (             
        
        <div class="panel panel-success">
              <div class="panel-heading">
                    <h3 class="panel-title">List Task</h3>
              </div>
              
              <table class="table table-hover">
                  <thead>
                      <tr>
                          <th>#</th>
                      </tr>
                  </thead>
                  <tbody>
                      <tr>
                          <td></td>
                      </tr>
                  </tbody>
              </table>
              
        </div>
         
    );
  }
}

export default List;
